import { useEffect, useState } from "react"
import { useNavigate, useParams } from "react-router-dom"
import "./BookingForm.css"

export const BookingForm = () => {

    const { clientId } = useParams() 
    const [genres, setGenres] = useState([])
    const [client, setClients] = useState([])


    const [request, setBookingForm] = useState({

        bandName: "",
        phoneNumber: "",
        genreId: 0,
        numOfSongs: "",
        startDate: "",
        endDate: "",
        musicianRequest: false,
        sessionMusicians: false,
        photoRequest: false,
        videoRequest: false, 
        requestId: 0, 
        clientId: 0 

    })

    const navigate = useNavigate()

    const localFatBackUser = localStorage.getItem("fatback_user")
    const fatbackUserObject = JSON.parse(localFatBackUser)

    useEffect(
        () => {
            fetch(`http://localhost:8088/genres`)
                .then(response => response.json())
                .then((genreArray) => {
                    setGenres(genreArray)
                })
        },
        []

    )

    useEffect(
        () => {
            fetch(`http://localhost:8088/clients`)
                .then(response => response.json())
                .then((genreArray) => {
                    setClients(genreArray)
                })
        },
        []

    )


    const submitButtonClick = (event) => {
        event.preventDefault()

        const requestFormToSendToAPI = {

            clientId: client.id,
            requestId: request.id,
            bandName: request.bandName,
            phoneNumber: request.phoneNumber,
            genreId: request.genreId,
            numOfSongs: request.numOfSongs,
            startDate: request.startDate,
            endDate: request.endDate,
            musicianRequest: request.musicianRequest,
            sessionMusicians: request.sessionMusicians,
            photoRequest: request.photoRequest,
            videoRequest: request.videoRequest

        }

        return fetch(`http://localhost:8088/requests`, {
            method: "POST",
            headers: {
                "Content-Type": "application/json",
            },
            body: JSON.stringify(requestFormToSendToAPI)
        })

            .then(response => response.json())
            .then(() => {
                navigate(`/myrequest/${id}`)
            })

    }

    return (
        < div className="bookingForm" >
            <h2>Booking Form</h2>
            <form>

                <fieldset >
                    <div className="form-group">
                        <label htmlFor="bandName">Band Name: </label>
                        <input
                            required autoFocus
                            type="text"
                            className="form-control"
                            value={request.bandName}
                            onChange={
                                (event) => {
                                    const copy = { ...request }
                                    copy.bandName = event.target.value
                                    setBookingForm(copy)
                                }
                            }
                        />
                    </div>
                </fieldset>

                <fieldset>
                    <div className="form-group">
                        <label htmlFor="phoneNumber">
                            Phone Number:
                        </label>
                        <input
                            required autoFocus
                            type="text"
                            className="form-control"
                            placeholder="Your number..."
                            value={request.phoneNumber}
                            onChange={
                                (event) => {
                                    const copy = { ...request }
                                    copy.phoneNumber = event.target.value
                                    setBookingForm(copy)
                                }
                            }
                        />

                    </div>
                </fieldset>

                <fieldset>
                    <div className="form-group">
                        <label htmlFor="genre">Choose a genre:</label>
                        <select id="genre"  required
                            onChange={
                                (event) => {
                                    const copy = { ...request }
                                    copy.genreId = parseInt(event.target.value)
                                    setBookingForm(copy)
                                }}>
                            <option value="0">Genre...</option>

                            {
                                genres.map(
                                    (genre) => {
                                        return <option
                                            key={`genre--${genre.id}`}
                                            value={genre.id}>{genre.type}</option>
                                    }
                                )
                            }
                        </select>

                    </div>
                </fieldset>

                <fieldset>
                    <div className="form-group">
                        <label htmlFor="songs">
                            No. of Songs:
                        </label>
                        <input
                            required autoFocus
                            type="text"
                            className="form-control"
                            value={request.numOfSongs}
                            onChange={
                                (event) => {
                                    const copy = { ...request }
                                    copy.numOfSongs = event.target.value
                                    setBookingForm(copy)
                                }
                            }

                        />

                    </div>
                </fieldset>

                <fieldset>
                    <div className="form-group">
                        <label htmlFor="date">
                            Start Date:
                        </label>
                        <input

                            type="date"
                            required
                            className="form-control"
                            onChange={
                                (event) => {
                                    const copy = { ...request }
                                    copy.startDate = event.target.value
                                    setBookingForm(copy)
                                }
                            }

                        />

                    </div>
                </fieldset>

                <fieldset>
                    <div className="form-group">
                        <label htmlFor="date">
                            End Date:
                        </label>
                        <input
                            required
                            type="date"
                            className="form-control"
                            onChange={
                                (event) => {
                                    const copy = { ...request }
                                    copy.endDate = event.target.value
                                    setBookingForm(copy)
                                }
                            }

                        />

                    </div>
                </fieldset>

                <fieldset>
                    <div className="form-group">
                        <label htmlFor="band">
                            Do you have musicians or a band?
                        </label>

                        <div className="radioButton">
                            <input
                                required autoFocus
                                type="radio"
                                className="form-control"
                                value={request.musicianRequest}
